public class intergerDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 100, b= 10;
		System.out.println(a + b);
		System.out.println((a+ b) / 5);
		System.out.println(((a + b) / 10) - 10);
		System.out.println((((a + b) / 10) - 10) * 10);
		
	}

}
